  [],\n\t\"revision_timestamp\": \"2016-02-27T17:19:13.648019\",\n\t\"name\": \"consent-based-verification-system-cbsv\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"CBSV is a fee-based service offered by SSA's
  Business Services Online (BSO). It is used by private companies to verify the SSNs
  of their customers and clients that have provided written consent. Prior to submitting
  verifications, CBSV interacts with SSOARS to confirm positive account balance and
  AWT to confirm a valid agreement exists. CBSV users have the option of using a web
  service, an online service to verify up to 10 SSNs for immediate results or upload
  batch files for overnight processing. CBSV uses the Numident Online Verification
  Utility (NOVU) for the online requests and EVS for the batch requests. The CBSV
  application is maintained by OSES while AWT, NOVU and EVS are maintained in OEEAS
  DIVES Verification Systems Branch.\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
